    let grid = document.getElementById('grid');
    let firstCard, secondCard;
    let lockBoard = false;

    function createCard(image) {
        const card = document.createElement('div');
        card.classList.add('card');
        const img = document.createElement('img');
        img.src = image;
        card.appendChild(img);
        card.addEventListener('click', flipCard);
        grid.appendChild(card);
    }

    function flipCard() {
        if (lockBoard || this === firstCard) return;
        this.classList.add('flipped');

        if (!firstCard) {
            firstCard = this;
            return;
        }

        secondCard = this;
        checkForMatch();
    }

    function checkForMatch() {
        lockBoard = true;
        const isMatch = firstCard.querySelector('img').src === secondCard.querySelector('img').src;

        if (isMatch) {
            resetBoard();
        } else {
            setTimeout(() => {
                firstCard.classList.remove('flipped');
                secondCard.classList.remove('flipped');
                resetBoard();
            }, 1000);
        }
    }

    function resetBoard() {
        [firstCard, secondCard] = [null, null];
        lockBoard = false;
    }

    function shuffleAndCreateBoard() {
        grid.innerHTML = ''; // Очищаем игровое поле  
        const difficulty = document.getElementById('difficulty').value;
        const order = document.getElementById('order').value;
        let pairs, columns;

        switch (difficulty) {
            case 'easy':
                pairs = 4; // 4 пары  
                columns = 4; // 4 колонки  
                break;
            case 'medium':
                pairs = 8; // 8 пар  
                columns = 4; // 4 колонки  
                break;
            case 'hard':
                pairs = 15; // 15 пар  
                columns = 6; // 6 колонок  
                break;
            case 'extreme':
                pairs = 24; // 24 пары  
                columns = 8; // 8 колонок  
                break;
            default:
                pairs = 4;
                columns = 4; // 2 колонки по умолчанию  
        }

        if (pairs > images.length) {
            alert("Недостаточно изображений для выбранного уровня сложности!");
            return;
        }

        const images_ = images.slice();

        if (order === 'random') {
            images_.sort(() => Math.random() - 0.5); // Перемешиваем карты, если выбран случайный порядок  
        }

        const selectedImages = [...images_.slice(0, pairs), ...images_.slice(0, pairs)]; // Выбираем нужное количество пар
        selectedImages.sort(() => Math.random() - 0.5); // Перемешиваем карты

        selectedImages.forEach(createCard);

        // Обновляем количество колонок в сетке  
        grid.style.gridTemplateColumns = `repeat(${columns}, 1fr)`;
    }

    document.getElementById('resetButton').addEventListener('click', shuffleAndCreateBoard);
    document.getElementById('difficulty').addEventListener('change', shuffleAndCreateBoard);
    document.getElementById('order').addEventListener('change', shuffleAndCreateBoard);

    // Инициализируем игровое поле при загрузке  
    shuffleAndCreateBoard();

